import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const AddRestaurant = () => {
  const [formData, setFormData] = useState({
    name: '',
    menuType: '',
    address: {
      street: '',
      city: '',
      postalCode: '',
      country: ''
    },
    description: '',
  });
  const [error, setError] = useState(null);
  const navigate = useNavigate();

  const handleChange = (e) => {
    const { name, value } = e.target;

    if (name.startsWith('address.')) {
      const addressField = name.split('.')[1];
      setFormData(prev => ({
        ...prev,
        address: {
          ...prev.address,
          [addressField]: value,
        }
      }));
    } else {
      setFormData(prev => ({
        ...prev,
        [name]: value,
      }));
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError(null);

    try {
      await axios.post('/api/restaurants', formData);
      navigate('/');
    } catch (err) {
      setError('Failed to add restaurant. Please try again.');
    }
  };

  return (
    <div className="add-restaurant-page max-w-full mx-auto p-4 overflow-auto">
      <h1 className="text-2xl font-semibold mb-6">Add New Restaurant</h1>
      {error && <p className="error-message text-red-600 mb-4">{error}</p>}
      <form onSubmit={handleSubmit} className="flex flex-row items-start space-x-6 whitespace-nowrap">

        <label className="flex flex-col">
          <span className="mb-1 font-medium">Name:</span>
          <input
            name="name"
            type="text"
            value={formData.name}
            onChange={handleChange}
            required
            className="border px-3 py-2 rounded w-40"
          />
        </label>

        <label className="flex flex-col">
          <span className="mb-1 font-medium">Cuisine Type:</span>
          <input
            name="menuType"
            type="text"
            value={formData.menuType}
            onChange={handleChange}
            required
            className="border px-3 py-2 rounded w-40"
          />
        </label>

        <div className="flex flex-row space-x-4">
          <label className="flex flex-col">
            <span className="mb-1">Street:</span>
            <input
              name="address.street"
              type="text"
              value={formData.address.street}
              onChange={handleChange}
              required
              className="border px-3 py-2 rounded w-36"
            />
          </label>

          <label className="flex flex-col">
            <span className="mb-1">City:</span>
            <input
              name="address.city"
              type="text"
              value={formData.address.city}
              onChange={handleChange}
              required
              className="border px-3 py-2 rounded w-28"
            />
          </label>

          <label className="flex flex-col">
            <span className="mb-1">Postal Code:</span>
            <input
              name="address.postalCode"
              type="text"
              value={formData.address.postalCode}
              onChange={handleChange}
              required
              className="border px-3 py-2 rounded w-24"
            />
          </label>

          <label className="flex flex-col">
            <span className="mb-1">Country:</span>
            <input
              name="address.country"
              type="text"
              value={formData.address.country}
              onChange={handleChange}
              required
              className="border px-3 py-2 rounded w-28"
            />
          </label>
        </div>

        <label className="flex flex-col">
          <span className="mb-1 font-medium">Description:</span>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
            className="border px-3 py-2 rounded w-60"
            rows={1}
          />
        </label>

        <button
          type="submit"
          className="bg-blue-600 text-white py-2 rounded hover:bg-blue-700 transition h-fit self-end"
        >
          Add Restaurant
        </button>
      </form>
    </div>
  );
};

export default AddRestaurant;
